#include <iostream>

using namespace std;

int main(){
	string input = "";
	
	for (size_t i = 0; i < input.size(); ++i){
		if (i%48==0) cout << endl;
		cout << input[i];
	}
	cout << endl;
	cout << endl;
	
	string first = "";
	string second = "";
	string third = "";

	for (size_t i = 0; i < 64; ++i){
		if (i%32==0){
			cout << first;
			cout << second;
			cout << third;
			first = "";
			second = "";
			third = "";
		}
		for (size_t j = 0; j < 48; ++j){
			if (j < 16){
				first += input[j + 48*i];
			}
			else if (j < 32){
				second += input[j+48*i];
			}
			else{
				third += input[j+48*i];
			}
		}
	}
	
	cout << first;
	cout << second;
	cout << third;
}
